export default function TaskPage(props) {
	const { task } = props;

	if (task === "task1") {
		<Task1Page
			videoId={this.state.videoId}
			handleVideoPlay={props.handleVideoPlay}
			handleNavigationButtonClick={props.handleNavigationButtonClick}></Task1Page>;
	}
}
